Solution: Here is a possible implementation of this function in TypeScript:
```typescript
function getElapsedTime(postDate: Date): string {
  const now = new Date();
  const diffInSeconds = Math.abs((now.getTime() - postDate.getTime()) / 1000);

  if (diffInSeconds < 60) {
    return `${Math.round(diffInSeconds)} seconds ago`;
  } else if (diffInSeconds < 3600) {
    return `${Math.round(diffInSeconds / 60)} minutes ago`;
  } else if (diffInSeconds < 86400) {
    return `${Math.round(diffInSeconds / 3600)} hours ago`;
  } else {
    return `${Math.round(diffInSeconds / 86400)} days ago`;
  }
}
```
This function takes in a date object representing the time the post was made and calculates the difference between that time and the current time in seconds. It then uses conditional logic to determine whether the elapsed time is less than one minute, less than one hour, less than one day, or greater than one day. In each case, it rounds the number of seconds, minutes, hours, or days to the nearest integer and returns a string in the appropriate format.

